import React, { Component } from 'react';
import 'deliveryTime.scss';

class DeliveryTime extends Component {
    render() {
        const {time} = this.props;
        return (
            <h1>Delivery in {time} minutes</h1>
        )
    }
}

export default DeliveryTime;
